const AjouterAction=(pays)=>{
    return {type:'AjouterActionPAY',payload:pays}
};

const ModifierAction=(ModPays)=>{
    return {type:'ModifierAction_PUPLATION',payload:ModPays}
};

const SupprimierAction=(idPays)=>{
    return {type:'SUPREMIER_PUPLATION',payload:idPays}
};
export {AjouterAction,ModifierAction,SupprimierAction}
